import React from "react";
import { useParams } from "react-router";

const QuoteDetail = () => {
  const params = useParams();
  return (
    <React.Fragment>
      <h1>QUOTE DETAIL</h1>;
      <h2>{params.quoteId}</h2>
    </React.Fragment>
  );
};
export default QuoteDetail;
